import React from 'react'
import { Redirect } from 'react-router-dom'

export default class Devid extends React.Component {
    constructor(props) {
        super(props);

        this.state = {
            redirect: false,
            devId: ""
          }

        this.handleChange = this.handleChange.bind(this);

      }


  setRedirect = () => {
    this.setState({
      redirect: true
    })
  }
  renderRedirect = () => {
    if (this.state.redirect) {
      return <Redirect to='/' />
    }
  }
  render () {
    return (
       <div>
        <input devId={this.state.value} />
        {this.renderRedirect()}
        <button onClick={this.setRedirect}>Redirect</button>
       </div>
    )
  }
}
